import "./MenuTopRight.css";

function MenuTopRight() {
    return (
        <div className="top-right">
            <h1>Pancake</h1>
            <p>Млечно - Бело - Темно чоколадо, банана, јагода</p>
        </div>
    )
}

export default MenuTopRight;
